const $ = require('jquery');
const Croppie = require('croppie');

const root = document.getElementById('root');
root.addEventListener('update', evt => {
  console.log('update');
  crop.result('base64').then(dataurl => {
    $('#result').attr('src', dataurl);
  });
});

const crop = new Croppie(root, {
  viewport: { width: 433, height: 596 },
  boundary: { width: 433, height: 596 },
  enableOrientation: true,
});

$('#file').change(evt => {
  var fr = new FileReader();
  fr.onload = function() {
    crop.bind({
      url: fr.result,
    });
  };
  fr.readAsDataURL(evt.target.files[0]);
});

$('#download').click(() => {
    setTimeout(() => {
      var img1 = document.getElementById('result');
      var img2 = document.getElementById('cover');
      var canvas = document.getElementById('canvas');
      var context = canvas.getContext('2d');
      canvas.width = img1.width;
      canvas.height = img1.height;
      context.drawImage(img1, 0, 0);
      context.drawImage(img2, 0, 0);
      canvas.toBlob(blob => saveAs(blob));
      // window.open(canvas.toDataURL('image/jpeg'));
    }, 500);
});

$('.cr-viewport').append(
  '<img id="cover" src="data:image/png;base64," class="cover" />',
);
